import React, { useEffect, useState } from 'react';
import api from '../api/axios';

export default function Agents() {
  const [agents, setAgents] = useState([]);
  const [form, setForm] = useState({ name: '', email: '', mobile: '', password: '' });
  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');

  const load = async () => {
    const res = await api.get('/agents');
    setAgents(res.data);
  };
  useEffect(() => { load(); }, []);

  const submit = async (e) => {
    e.preventDefault();
    setError(''); setSuccess('');
    try {
      await api.post('/agents', form);
      setSuccess('Agent created');
      setForm({ name: '', email: '', mobile: '', password: '' });
      load();
    } catch (err) {
      setError(err.response?.data?.message || 'Failed to create agent');
    }
  };

  return (
    <div>
      <h2>Agents</h2>
      <form onSubmit={submit} style={{ display: 'grid', gap: 8, maxWidth: 520, background: 'white', padding: 16, borderRadius: 12 }}>
        <div><label>Name</label><input value={form.name} onChange={e => setForm({ ...form, name: e.target.value })} required /></div>
        <div><label>Email</label><input value={form.email} onChange={e => setForm({ ...form, email: e.target.value })} type="email" required /></div>
        <div><label>Mobile (+country code)</label><input value={form.mobile} onChange={e => setForm({ ...form, mobile: e.target.value })} placeholder="+1XXXXXXXXXX" required /></div>
        <div><label>Password</label><input value={form.password} onChange={e => setForm({ ...form, password: e.target.value })} type="password" required /></div>
        {error && <div style={{ color: 'red' }}>{error}</div>}
        {success && <div style={{ color: 'green' }}>{success}</div>}
        <button type="submit" style={{ width: 160, padding: 10, background: '#16a34a', color: 'white', border: 0, borderRadius: 8 }}>Add Agent</button>
      </form>

      <h3 style={{ marginTop: 24 }}>Agent List</h3>
      <table style={{ width: '100%', background: 'white', borderCollapse: 'collapse' }}>
        <thead>
          <tr>
            <th style={{ textAlign: 'left', padding: 8 }}>Name</th>
            <th style={{ textAlign: 'left', padding: 8 }}>Email</th>
            <th style={{ textAlign: 'left', padding: 8 }}>Mobile</th>
            <th style={{ textAlign: 'left', padding: 8 }}>Created</th>
          </tr>
        </thead>
        <tbody>
  {agents.map(a => (
    <tr key={a._id} style={{ borderTop: '1px solid #e5e7eb' }}>
      <td style={{ padding: 8 }}>{a.name}</td>
      <td style={{ padding: 8 }}>{a.email}</td>
      <td style={{ padding: 8 }}>{a.mobile}</td>
    </tr>
  ))}
</tbody>

      </table>
    </div>
  );
}
